Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"846682", :vin=>"5NPEC4AB8EH846682", :year=>"2014", :make=>"Hyundai", :model=>"Sonata", :bodytype=>"4dr Car", :trim=>"Limited", :color=>"Radiant Silver Metallic", :interiorcolor=>"Gray", :cylinder=>"4", :transmission=>"Automatic", :miles=>"49657", :price=>"16750", :description=>"Sculpted in a beautiful Radiant Silver paint scheme, is our Clean CarFax 2014 Hyundai Sonata SE Sedan. From the sculpted grille to the raked roofline, Hyundai's signature design has created a family sedan that has won the hearts of people around the world. Under the hood sits our Turbo Charged 2.0 Liter 4 Cylinder that produces a healthy 274hp and is paired with quick shifting 6 Speed Automatic transmission and Front Wheel Drive that can achieve near 32mpg on the open road. On the outside, this SE includes distinctive alloy wheels, fog lights, and dual exhaust. Our pictures display an interior that would make anyone feel at home. The roomy, well-built cabin provides more interior room and a more significant trunk than many of its closest competitors without cramping your lifestyle.Step inside, and you'll be greeted by bolstered sport seats, Hyundai's incredibly intuitive Blue Link telematics system, and keyless entry. The Sonata has received a 2012 Top Safety Pick award from the IIHS as well as a 5-star overall crash rating by the NHTSA, the first midsize car to do so under the federal governments more stringent guidelines. It's time to reward yourself by driving a family sedan that doesn't scream boring. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"RADIANT SILVER METALLIC,CARPETED FLOOR MATS,WHEEL LOCKS,OPTION GROUP 1,CARGO NET,GRAY  LEATHER SEATING SURFACES,Turbocharged,Front Wheel Drive,Power Steering,ABS,4-Wheel Disc Brakes,Brake Assist,Aluminum Wheels,Tires - Front Performance,Tires - Rear Performance,Temporary Spare Tire,Sun/Moonroof,Generic Sun/Moonroof,Heate