Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"347982", :vin=>"3GCUKSEC3EG347982", :year=>"2014", :make=>"Chevrolet", :model=>"Silverado 1500", :bodytype=>"Crew Cab Pickup", :trim=>"LTZ", :color=>"Silver Ice Metallic", :interiorcolor=>"Jet Black", :cylinder=>"8", :transmission=>"Automatic", :miles=>"65640", :price=>"34850", :description=>"Conquer the road in our legendary Clean Carfax 2014 Chevrolet Silverado 1500 Crew Cab LTZ 4x4 decked out in handsome Silver Ice Metallic. Under the hood of this redesigned flagship of Chevrolet is a 5.3 Liter V8 offers 355hp. It offers exceptional fuel economy of 23mpg and a tough 6 Speed Automatic transmission. Muddy rural roads, mountain terrain, towing your boat, or hauling lumber are no challenge for our Four Wheel Drive Silverado. The beefy front suspension eases you down the road in comfort while the rear setup is tough enough to keep up with your demanding life. The commanding appearance of this LTZ with 20-inch alloy wheels improves any landscape. Meanwhile, the upscale interior features an exclusive dash design with wood and metallic accents, leather heated front bucket seats and driver-seat memory settings that make you feel like the king of the road. MyLink, a massive central display, Bluetooth and a Bose audio system with a six-disc CD changer, a USB/iPod interface, and rear audio controls keeps you connected and entertained along the way. Well-known GM safety features are in place like Stabilitrak, 4-wheel ABS, daytime running lamps, and plenty of airbags. This no-nonsense truck will make sure it fulfills your needs for work and play. Get the job done right with the security, performance, and comfort that only come from the Chevrolet Silverado. Don't delay! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE  5.3L FLEXFUEL ECOTEC3 V8 WITH ACTIVE FUEL MANAGEMENT  DIRECT INJECTION AND VARIABLE VALVE TIMING  includes aluminum block construction with Flex Fuel capability  capable of running on unleaded or up to 85% ethanol (355 hp [265 kW] @ 5600 rpm  383 lb-ft of torque [518 Nm] @ 4100 rpm; more than 300 lb-ft of torque from 2000 to 5600 rpm) (STD),Tow Hitch,Aluminum Wheels,Tow Hooks,Locking/Limited Slip Differential,Four Wheel Drive,Power Steering,ABS,4-Wheel Disc Brakes,Traction Control,Stability Control,Tires - Front All-Terrain,Tires - Rear All-Terrain,Conventional Spare Tire,Fog Lamps,Heated Mirrors,Power Mirror(s),Integrated Turn Signal Mirrors,Power Folding Mirrors,Privacy Glass,AM/FM Stereo,Satellite Radio,MP3 Player,Bluetooth Connection,Auxiliary Audio Input,Smart Device Integration,CD Player,HD Radio,Power Driver Seat,Power Passenger Seat,Leather Seats,Split Bench Seat,Heated Front Seat(s),Driver Adjustable Lumbar,Passenger Adjustable Lumbar,Seat Memory,Pass-Through Rear Seat,Rear Bench Seat,Floor Mats,Cruise Control,Steering Wheel Audio Controls,Leather Steering Wheel,Adjustable Steering Wheel,Power Windows,Power Door Locks,Keyless Entry,Remote Engine Start,Universal Garage Door Opener,Security System,Mirror Memory,Climate Control,Multi-Zone A/C,Rear Defrost,Sliding Rear Window,Auto-Dimming Rearview Mirror,Driver Vanity Mirror,Passenger Vanity Mirror,Driver Illuminated Vanity Mirror,Passenger Illuminated Visor Mirror,Daytime Running Lights,Driver Air Bag,Passenger Air Bag,Front Side Air Bag,Front Head Air Bag,Rear Head Air Bag,Passenger Air Bag Sensor,Telematics,Navigation from Telematics,Back-Up Camera,Tire Pressure Monitor", :fuel=>"Flex Fuel", :title=>"2014 Chevrolet Silverado 1500", :external_image=>"https://content.homenetiol.com/2001923/2134085/0x0/1fb81e49d6d4474298b2652aded87e8a.jpg", :external_imagefront=>"https://content.homenetiol.com/2001923/2134085/0x0/f673b5816e8442bf80dc2944b6aa4cdc.jpg", :external_imageback=>"https://content.homenetiol.com/2001923/2134085/0x0/4ac1cb7322cd41e4b4420381630335c0.jpg", :external_imageleft=>"https://content.homenetiol.com/2001923/2134085/0x0/0a5ca7