Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"E56386", :vin=>"1FTFW1ET8DKE56386", :year=>"2013", :make=>"Ford", :model=>"F-150", :bodytype=>"Crew Cab Pickup", :trim=>"Lariat", :color=>"Tuxedo Black Metallic", :interiorcolor=>"Pecan w/Black Interior", :cylinder=>"6", :transmission=>"Automatic", :miles=>"88953", :price=>"30850", :description=>"Meet our One Owner 2013 Ford F-150 XL SuperCrew 4x4 shown in brilliant Tuxedo Black. This handsome truck starts with a get it done attitude. A Twin Turbo 3.5 Liter EcoBoost V6 that offers 365hp on demand while paired with a 6 Speed Automatic w/Tow/Haul Mode you will have no problem pulling in up to 22mpg while enjoying a smooth and quiet ride. Our Ford Tough F-150 is one of the top selling full-size trucks on the market today due to it's reliability and performance. Best in class in towing and payload capabilities make this functional but it's a darn good looking truck too! Who would have thought Turbo and 4x4 went together like this. Ford has a winner here! Inside you can expect the same durability and style with SuperCrew. You will find comfortable seating for your crew with an easy to read display center and great storage spaces. With this XL, you are good to go with a superb, reliable truck for a great price! Did you see the sunroof? Ford always comes through with safety and F-150 ranks at the top. It's high strength steel safety cage keeps you secure along with six standard airbags, SOS post crash Alert, Trailer Sway and Roll Stability control and anti-lock brakes. F-150 has everything you could ask for in a full-size truck. Whether it's for work or play you have made an excellent choice! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Four Wheel Drive,Tow Hitch,Tow Hooks,Power Steering,4-Wheel Disc Brakes,Tires - Front All-Terrain,Tires - Rear All-Terrain,Aluminum Wheels,Conventional Spare Tire,Automatic Headlights,Fog Lamps,Heated Mirrors,Powe