Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"211113", :vin=>"1FADP3KE8FL211113", :year=>"2015", :make=>"Ford", :model=>"Focus", :bodytype=>"Hatchback", :trim=>"SE", :color=>"Oxford White", :interiorcolor=>"Charcoal Black", :cylinder=>"3", :transmission=>"Manual", :miles=>"48779", :price=>"10500", :description=>"Our One Owner Clean Carfax 2015 Ford Focus SE Hatchback in Oxford White offers impressive handling, efficiency and absolute comfort! You will certainly be impressed with the crisp punch this 160hp 2.0 Liter 4 Cylinder delivers. The fun-to-drive 6 Speed Manual transmission with start/stop makes for an enjoyable ride that pulls in up to 36mpg! Whether you're headed to work or play, the Focus SE is just simply a joy to drive! You'll love the modern look with 16 inch wheels and automatic quad beam headlights! Everything was designed with the driver in mind from a trip computer, power accessories, rear view camera, front center storage console and plenty of head and leg room. You'll also appreciate MyKey and the SYNC voice-activated phone and audio player interface with Bluetooth, a six-speaker sound system, steering-wheel mounted audio controls, CD player and auxiliary audio jack. This hatchback has plenty of cargo space to keep your active lifestyle on the go with you. The Ford Focus has a great reputation for safety! Six standard airbags, electronic stability control, anti-lock brakes and tire pressure monitoring all ensure the safest ride possible. The Focus offers everything you need for a stylish, fun, safe and economical ride. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE: 1.0L ECOBOOST  -inc: Start-Stop  Transmission: 6-Speed Manual,Front Wheel Drive,Power Steering,ABS,Front Disc/Rear Drum Brakes,Brake Assist,Brake Actuated Limited Slip Differential,Aluminum Wheels,Tires - Front Performance,Tires - Rear Performance,Temporary Spare Tire,Power Mirror(s),Rear Defrost,Int