Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"E65130", :vin=>"1FTEW1EG5FKE65130", :year=>"2015", :make=>"Ford", :model=>"F-150", :bodytype=>"Crew Cab Pickup", :trim=>"XLT", :color=>"Ingot Silver Metallic", :interiorcolor=>"Black", :cylinder=>"6", :transmission=>"Automatic", :miles=>"82576", :price=>"29950", :description=>"Even tougher and stronger than before, our Clean CarFax 2015 Ford F-150 XLT SuperCrew Four Wheel Drive with FX4 Package in Ingot Silver has been re-engineered with a high-strength, military grade, aluminum-alloy body and high-strength steel frame to increase capability and efficiency! The 3.5 Liter Flex Fuel V6 generates 283hp and 255 pound-feet of torque while tethered to a durable 6 Speed Automatic with Sport and Tow/Haul modes. No matter how grueling your day, you'll enjoy scoring near 25mpg on the highway and have the muscle to haul or pull heavy loads! Dominate the road in this F-150 that is both modern and aerodynamic in design with chrome trim, fog lights and prominent alloy wheels. You and your crew will be comfortable inside the well-thought out cabin with clever storage, power accessories, and cloth upholstery. Stay safely connected thanks to Ford's Sync voice control smartphone integration system, while taking advantage of Bluetooth phone/audio connectivity and USB/auxiliary audio input jacks for the sound system. Buckle-up your tool belt and enjoy this solid, composed ride! Safety features on our F-150 include anti-lock disc brakes, stability and traction control, trailer sway control, front-seat side impact airbags and full-length side-curtain airbags. Our F-150 is leading the way! Get behind the wheel of this workhorse today! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE: 3.5L V6 ECOBOOST  -inc: 3.31 Axle Ratio  GVWR: 7 000 lbs Payload Package,Four Wheel Drive,Power Steering,ABS,4-Wheel Disc Brakes,Brake Assist,Aluminum Wheels,Tires - Front All-Te