Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"222516", :vin=>"1G1PC5SH3G7222516", :year=>"2016", :make=>"Chevrolet", :model=>"Cruze Limited", :bodytype=>"4dr Car", :trim=>"LS", :color=>"Summit White", :interiorcolor=>"Jet Black/Medium Titanium", :cylinder=>"4", :transmission=>"Automatic", :miles=>"46991", :price=>"10500", :description=>"Proudly presenting our One Owner 2016 Chevrolet Cruze Limited LS in beautiful Summit White over Two Tone interior! Powering this graceful sedan is an ECOTEC 1.8 Liter 4 Cylinder that generates 138hp while paired with a smooth-shifting 6 Speed Automatic transmission. You'll enjoy great driving dynamics and score near 38mpg on the open road. Check out the bold and sporty stance of our Cruze Limited LS with its prominent grille! Open the door to find the spacious interior has been tailor-made for you with features that offer ultimate appeal. Remote keyless entry, steering wheel mounted audio controls, power windows with express-down, and OnStar make every ride feel first class. You'll also appreciate staying safely connected, Bluetooth, and a dynamite stereo with CD/MP3, satellite radio, and auxiliary input. Our Chevrolet Cruze Limited has been meticulously designed to keep you and your precious cargo out of harm's way with innovative safety features including StabiliTrak Electronic Stability Control and ten airbags. A beautiful blend of performance, efficiency, and style, this is a fantastic choice for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"LICENSE PLATE BRACKET  FRONT,TRANSMISSION  6-SPEED AUTOMATIC  ELECTRONICALLY CONTROLLED WITH OVERDRIVE,SEATS  FRONT BUCKET WITH RECLINING SEATBACKS AND ADJUSTABLE HEAD RESTRAINTS,LPO  CARGO NET,ENGINE  ECOTEC 1.8L VARIABLE VALVE TIMING DOHC 4-CYLINDER SEQUENTIAL MFI  (138 hp [102.9 kW] @ 6300 rpm  125 lb-ft of torque [168.8 N-m] @ 3800 rpm),JET BLACK/MEDIUM TITANIUM  PREMIUM CLOTH SEAT TRIM,LS PREFERRED EQU