Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"219398", :vin=>"1FADP3F24EL219398", :year=>"2014", :make=>"Ford", :model=>"Focus", :bodytype=>"4dr Car", :trim=>"SE", :color=>"Ingot Silver Metallic", :interiorcolor=>"Medium Light Stone", :cylinder=>"4", :transmission=>"Automatic", :miles=>"51999", :price=>"9850", :description=>"Meet our One Owner Clean Carfax 2014 Ford Focus SE sedan viewed in Ingot Silver Metallic. Take in the lean lines and smart styling then prepare to be impressed with the crisp punch of this 2.0 Liter. It offers 160hp on demand while sipping on Flex Fuel or unleaded and while connected to a quick shifting 5 Speed Manual, you will enjoy near 36mpg. With less trips to the gas pump you will have more time and money for the good things in life! Driving the Focus SE is pure enjoyment when you have amenities such as Ford Sync on-board. Voice-activated phone and stereo controls ensure your hands are on the wheel and eyes on the road. Combine the superb 6 speaker stereo system, comfortable seats, power windows and locks, tilt and telescoping steering wheel, a handy front center storage console and you are riding in style. Ford always strives to make your ride one of the safest on the road and once again they stepped up to the plate providing six standard airbags, electronic stability control, anti-lock brakes and tire pressure monitoring that all ensure the safest ride possible. It's no surprise the 2014 Ford Focus earned 5 stars on the national safety ratings. MyKey technology allows parents to designate a key that will operate special features such as speed and audio volume to ensure safe teen driving. You can't go wrong with a Ford Focus! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Front Wheel Drive,Power Steering,ABS,Front Disc/Rear Drum Brakes,Brake Assist,Brake Actuated Limited Slip Differential,Aluminum Wheels,Tires - Front Performance,Tires - Rear Performance,Tempo