Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"C49422", :vin=>"1FM5K8GT9DGC49422", :year=>"2013", :make=>"Ford", :model=>"Explorer", :bodytype=>"Sport Utility", :trim=>"Sport", :color=>"Ruby Red Metallic Tinted Clearcoat", :interiorcolor=>"Charcoal Black/Sienna Insert", :cylinder=>"6", :transmission=>"Automatic", :miles=>"85542", :price=>"21950", :description=>"Our athletic One Owner, Clean Carfax 2013 Ford Explorer Sport AWD displayed in beautiful Ruby Red Tinted Clearcoat is waiting for you! This 7 passenger SUV is powered by an incredible TurboCharged 3.5 Liter EcoBoost V6 that offers 350hp on demand while tethered to a smooth shifting 6 Speed SelectShift Automatic transmission for amazing passing power. This All Wheel Drive Sport can help you secure near 22mpg. You'll be ready for all road conditions and this bold design turns heads with its chrome accents, streamlined body colored molding and overall handsome style. Projector beam headlights and LED taillights set the stage while unique 20-inch wheels enhance the view. Look inside and see premium features everywhere like a dual-panel sunroof, full-color navigation, and a backup camera. MyFord Touch with Sony Audio offers the latest news, weather, and tunes with media hub. You'll have plenty of power points to keep everyone in the family plugged in. Rear climate control and dual screen DVD system to keep the passengers happy! Superb lighting and storage options make this Sport just right for your family's needs. This SUV from Ford is unparalleled in safety with airbags, SOS post-crash alert, tire pressure monitoring, reverse sensing system and traction control. MyKey even allows you to set controls such as speed and volume for young drivers. Get behind the wheel to see what The Sport can do for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Turbocharged,Four Wheel Drive,Tow Hooks,Power Steering,Tires - Front Performance,Tires - 