Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"002789", :vin=>"3VWBP7AJ8CM002789", :year=>"2012", :make=>"Volkswagen", :model=>"Jetta Sedan", :bodytype=>"4dr Car", :trim=>"SE PZEV", :color=>"Tempest Blue Metallic", :interiorcolor=>"Titan Black", :cylinder=>"5", :transmission=>"Manual", :miles=>"77077", :price=>"7950", :description=>"Radiating premium good looks inside and out, our One Owner 2012 Volkswagen Jetta SE PZEZ Sedan is presented in Tempest Blue Metallic. Powered by an impressive 2.5 Liter 5 Cylinder that offers 170hp while matched with a fun to drive 5 Speed Manual transmission for spirited passing authority. This Front Wheel Drive Jetta offers a composed ride and near 33mpg on the open road along with elegant and graceful with sporty contours and a confident stance. Our Jetta SE is classically elegant and graceful with sporty contours and a confident stance. Open the door and surround yourself with a very roomy interior with top-notch materials. Comfortable seating and all the logical amenities make for exciting ownership. Power windows, keyless entry, climate control, along with an awesome audio system w/media interface make every ride feel first class. Drive confidently knowing your Volkswagen Jetta has received excellent safety scores thanks to traction and stability control, front side airbags, side curtain airbags, active front head restraints, and anti-lock brakes with brake assist. Solid and substantial, this is German engineering that exudes refinement and a comfortable ride you'll look forward to each time you slide behind the wheel! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Traction Control,Brake Actuated Limited Slip Differential,Front Wheel Drive,Power Steering,4-Wheel Disc Brakes,Wheel Covers,Steel Wheels,Tires - Front All-Season,Tires - Rear All-Season,Heated Mirrors,Power Mirror(s),Integrated Turn Signal Mirrors,Intermittent Wipers,Variable Speed Intermitte