Listing.create({:user_id=>"864", :newused=>"Used", :stocknumber=>"C45409", :vin=>"1FTFW1ETXEFC45409", :year=>"2014", :make=>"Ford", :model=>"F-150", :bodytype=>"Crew Cab Pickup", :trim=>"XLT", :color=>"Oxford White", :interiorcolor=>"Steel Gray", :cylinder=>"6", :transmission=>"Automatic", :miles=>"76056", :price=>"26850", :description=>"Well-equipped and completely capable, our incredible Clean Carfax 2014 Ford F-150 XLT SuperCrew 4x4 is decked out in Oxford White. Under the hood is a Turbo Charged 3.5 Liter EcoBoost V6 that offers 365hp on tap while paired with a 6 Speed Automatic w/Tow/Haul Mode. You'll secure up to 22mpg on the open road while enjoying a quiet ride and experience the reliability and performance that have made the tough F-150 one of the top selling full-size trucks on the market today. Best in class once again in towing and payload capacity and equipped with 4x4, this workhorse always gets the job done! The strong exterior of our XLT is highlighted by a removable tailgate with lift assist, fog lamps and a very cool chrome grille. The cabin is durable and stylish with comfortable seating, an easy to read modern display center and great storage spaces. SYNC your phone to the AM/FM/CD stereo to become hands-free and focus on the road. This truck will feel as though it has been designed to fit your lifestyle with various modern innovations that make it a joy to drive. Ford always comes through with safety and F-150 ranks at the top. Its high strength steel safety cage keeps you secure along with 6 standard airbags, SOS post crash Alert, Trailer Sway and Roll Stability control and anti-lock brakes. F-150 has everything you could ask for in a full-size truck. Whether it's for work or play, you have made an excellent choice! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Four Wheel Drive,Power Steering,ABS,4-Wheel Disc Brakes,Aluminum Wheels,Tires - Front All-Terrain,Tires - Rear All-Terrain,C