Listing.create({:user_id=>"1072", :vin=>"1GKFC130X7J267951", :newused=>"Used", :stocknumber=>"HASN078", :year=>"2007", :make=>"GMC", :model=>"Yukon", :bodytype=>"SUV", :trim=>"SLE", :color=>"Special Paint", :interiorcolor=>"Ebony", :enginedescription=>"5.3L 8 Cylinders", :fuel=>"Flexible Fuel", :transmission=>"Automatic", :miles=>"121313", :price=>"11780", :options=>"Air Conditioning : Rear A/C,Convenience : Automatic Headlights,Convenience : Leather Steering Wheel,Convenience : Luggage Rack,Convenience : Steering Wheel Audio Controls,Heater, Rear Auxiliary With Rear Passenger Heating Ducts,Locks : Keyless Entry,Mirror, Inside Rearview Auto-Dimming With 8-Point Compass And Outside Temperature Display,Seats : Power Driver Seat,Seats : Rear Bench Seat,Theft-Deterrent System, Vehicle, Pass-Key Iii,Warning Tones, Headlamp On, Key-In-Ignition, Driver And Passenger Buckle Up Reminder And Turn Signal On,Window : Privacy Glass,Window : Rear Defrost,Windows, Power With Driver Express-Down And Lockout Features", :description=>"Ouch-Ouch-Ouch. LOW-LOW-LOW Green Tag Sale! How low? So low it hurts! For December only, Every vehicle reduced drastically for\u00C2\u00A0special cash sales. All prices must expire 12-31-18.   Nothing can take the place of a large, powerful and roomy SUV. It's for these faithful followers that GMC intends the Yukon. For this 2007 with an upgraded special paint scheme, upgrades and refinement mean this one has much, much more to offer than prior year models. This popular 5.3 Liter V8 engine also received a moderate boost in power and perhaps more important, an ingenious system that shuts down half the cylinders under light load, improving fuel economy by one or two miles per gallon for this Rear Wheel Drive machine. Inside, everything is better. Seats are lighter, more comfortable. The dash is seriously simplified, with major reductions in confusing knobs, buttons and displays. The interior styling is refreshingly elegant, hinting at aspirations for entry-luxury status. This Yukon is three inches longer than '06 models, nearly all of which goes to added front seat legroom and cargo area. In addition, this one comes loaded to the roof with all the features, including a DVD player! Check out our pictures and feature list to see all this Yukon has in store for you!  All in all, a nice package and a real leap forward from the previous generation. So- Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :title=>"2007 GMC Yukon", :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225106966_DSC_1718.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225109635_DSC_1719.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225108360_DSC_1720.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225111842_DSC_1721.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225113636_DSC_1722.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225116009_DSC_1723.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/250552/20180814225117492_DSC_1724.jpg", :external_url=>true, :approved=>true})
