Listing.create({:user_id=>"1072", :vin=>"1FAFP34Z23W244112", :newused=>"Used", :stocknumber=>"HCSJ098", :year=>"2003", :make=>"Ford", :model=>"Focus", :bodytype=>"Sedan", :trim=>"SE", :color=>"CD Silver Metallic", :interiorcolor=>"Black", :enginedescription=>"2.3L 4 Cylinders", :fuel=>"Gasoline", :transmission=>"Automatic", :miles=>"74059", :price=>"3770", :options=>"60/40 Split Fold Rear Seat W/Flip-Up Seat Cushion,Air Conditioning : A/C,Audio : Cd Player,Audio : Mp3 Player,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Driver Seat Manual Height Adjuster,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows W/Driver-Side One-Touch Down,Rear Window Defroster,Seats : Bucket Seats,Seats : Rear Bench Seat,Securilock Passive Anti-Theft System,Steering : Power Steering", :description=>"Our 2003 Ford Focus SE shown in CD Silver Metallic is a wonderful small car that's fun to drive and frugal with fuel. It's roomy for its class, offering generous accommodations for its front and rear passengers. Treat yourself to Ford's famous ZTEC 2.3 Liter 4 Cylinder, feeling at times on the highway more like a V-6 when you need a little extra punch.   This one loves to run and doesn't complain about visiting the upper reaches of the tachometer. The steering system is quick, fluid and responsive, always providing plenty of feedback from the road surface. It turns exactly when and where you want without the body roll suffered by other makes. Our focus is generously equipped with plenty of comfort features that you demand in a car. Check out the pictures and feature list!   Focus is a small car that never really feels small. Go ahead, grab the family or a few friends and bring them along! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :title=>"2003 Ford Focus", :external_image=>"http://images.deale