, wood grain style trim, automatic headlights, keyless entry, a stellar audio system, and much more.   Lots of safety features like traction control, 4-wheel ABS brakes, and plenty of airbags are in place. Your search for the perfect family sedan is over! If you're looking for a big, roomy sedan that won't break the bank, this Impala will thoroughly meet your needs and probably exceed your expectations. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :title=>"2008 Chevrolet Impala", :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175638543_DSC_2042.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175646305_DSC_2043.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175644155_DSC_2044.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175642200_DSC_2045.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175640285_DSC_2046.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175649979_DSC_2047.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/253061/20180821175651908_DSC_2048.jpg", :external_url=>true, :approved=>true})
