apability, versatility, and good looks. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :title=>"2004 Ford Expedition", :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205228912_DSC_3038.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205234554_DSC_3039.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205232567_DSC_3040.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205236567_DSC_3041.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205230697_DSC_3042.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205240397_DSC_3043.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/269955/20180928205241507_DSC_3044.jpg", :external_url=>true, :approved=>true})
