amily owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :title=>"2007 Dodge Nitro", :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225621314_DSC_4483.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225623666_DSC_4484.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225625852_DSC_4485.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225624672_DSC_4486.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225622439_DSC_4487.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225626876_DSC_4488.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/295868/20181204225628194_DSC_4489.jpg", :external_url=>true, :approved=>true})
